import React from "react";
import '../css/header.css';

const Headerarea = () =>{

    function navClick(e) {
        e.preventDefault();
        console.log('The link was clicked.');
      }
    return(
        <div className="headNav">
            <h1>
                
                <a href="javascript:void(0)" onClick={navClick}>WEB TEST03</a>
            
            </h1>
            <nav>
                <ul>
                
                    <li><a href="javascript:void(0)" onClick={navClick}>HOME</a></li>
                    <li><a href="javascript:void(0)" onClick={navClick}>ISBNコード</a></li>
                    <li><a href="javascript:void(0)" onClick={navClick}>タイトル</a></li>
                    <li><a href="javascript:void(0)" onClick={navClick}>著者</a></li>
                    
                
                </ul>
            </nav>
        </div>
   
    );

};

export default Headerarea;
